import { NavBar } from "./components/NavBar/NavBar"
import {BrowserRouter, Route, Switch} from "react-router-dom"

function App() {
  return (
    <div className="App">
      <BrowserRouter>
      <NavBar></NavBar>

      <Switch>
        <Route></Route>
      </Switch>
      </BrowserRouter>
    </div>
  );
}

export default App;
